import React from "react";
import {Link} from 'react-router-dom';
import { Button } from 'semantic-ui-react'

const ButtonExampleEmphasis = () => (
    <div>
      <Button primary>Primary</Button>
      <Button secondary>Secondary</Button>
    </div>
  )
const Home = () => {
    return (
        <div>
            <h1>Welcome to Stranger Things! This is your one stop shop to buy or sell all used items!</h1>
            <Button color= 'green'>
                <Link to='/login'>Login</Link>
            </Button>
                <h2>Don't have an account yet? You'll need one to be able to create a post!</h2>
            <Button class= "ui">
            <Link to='/register'>Register Here</Link>
            </Button>
            <div><button class="ui primary button" color='purple'>Primary</button><button class="ui secondary button">Secondary</button></div></div>
        
        
    )
}

export default Home;
